import React from "react"
// ^----inorder to write in the jsx you need the react import
function HelloDiv() {
  return (
    <div>
      <h1>Hello! My name is Matthew Atchley</h1>
      <ul>
        <li>I like Corgis</li>
        <li>I'm an awful person</li>
        <li>Please let me find peace</li>
      </ul>
    </div>
  )
}

export default HelloDiv;


